                frequencyTwo[s2[i]] ? frequencyTwo[s2[i]] += 1 : frequencyTwo[s2[i]] = 1;
            }

               if(frequencyOne[key] !== frequencyTwo[key]){
                   return false;
               }

            }
            return true;
        // add whatever parameters you deem necessary - good luck!
        }
